--
-- Definition for view dispatches_raw
--
DROP VIEW IF EXISTS dispatches_raw CASCADE;
CREATE OR REPLACE 
	DEFINER = 'root'@'localhost'
VIEW dispatches_raw
AS
	select `ds`.`DispatchID` AS `DispatchID`,cast(`ds`.`FromDateTime` as date) AS `DispatchDate`,cast(`ds`.`FromDateTime` as time) AS `DispatchFromTime`,cast(`ds`.`ToDateTime` as time) AS `DispatchToTime`,`c`.`CompanyID` AS `CompanyID`,`c`.`CompanyName` AS `CompanyName`,`c`.`CompanyCode` AS `CompanyCode`,`l`.`LocationID` AS `LocationID`,`l`.`LocationName` AS `LocationName`,`l`.`LocationCode` AS `LocationCode`,`d`.`DriverID` AS `DriverID`,concat(`d`.`LastName`,' ,',`d`.`FirstName`) AS `DriverName`,`d`.`DriverCode` AS `DriverCode`,`lic`.`LicenseID` AS `LicenseID`,`lic`.`LicenseName` AS `LicenseName`,`ds`.`IsCancelled` AS `IsCancelled`,`ds`.`IsConfirmed` AS `IsConfirmed`,(case when (`ds`.`SpecialPayRate` is not null) then `ds`.`SpecialPayRate` when (`d`.`PayRateOverride` > 0.0) then `d`.`PayRateOverride` when (`pay`.`PayRate` is not null) then `pay`.`PayRate` else 0.0 end) AS `DriverPayRate`,ifnull(`payc`.`PayRate`,0.0) AS `CompanyPayRate`,ifnull(`payc`.`PayRateOT`,0.0) AS `CompanyPayRateOT`,round(sum(((timestampdiff(MINUTE,`ds`.`FromDateTime`,`ds`.`ToDateTime`) - `ds`.`LunchTime`) / 60.0)),2) AS `TotalTime` from ((((((`dispatches` `ds` join `companies` `c` on((`ds`.`CompanyID` = `c`.`CompanyID`))) join `locations` `l` on((`ds`.`LocationID` = `l`.`LocationID`))) join `drivers` `d` on((`ds`.`DriverID` = `d`.`DriverID`))) join `const_licenses` `lic` on((`d`.`LicenseID` = `lic`.`LicenseID`))) left join `companies_licenses_payrate` `pay` on(((`pay`.`CompanyID` = `c`.`CompanyID`) and (`pay`.`LicenseID` = `d`.`LicenseID`) and (`ds`.`FromDateTime` >= `pay`.`FromDate`) and ((`ds`.`ToDateTime` <= `pay`.`ToDate`) or isnull(`pay`.`ToDate`))))) left join `companies_invoicing_payrate` `payc` on(((`payc`.`CompanyID` = `c`.`CompanyID`) and (`payc`.`LicenseID` = `d`.`LicenseID`) and (`ds`.`FromDateTime` >= `payc`.`FromDate`) and ((`ds`.`ToDateTime` <= `payc`.`ToDate`) or isnull(`payc`.`ToDate`))))) group by `c`.`CompanyID`,`l`.`LocationID`,`d`.`DriverID`,cast(`ds`.`FromDateTime` as date);

--
-- Definition for view dispatches_hours
--
DROP VIEW IF EXISTS dispatches_hours CASCADE;
CREATE OR REPLACE 
	DEFINER = 'root'@'localhost'
VIEW dispatches_hours
AS
	select `ds`.`DispatchID` AS `DispatchID`,`ds`.`DispatchDate` AS `DispatchDate`,`ds`.`DispatchFromTime` AS `DispatchFromTime`,`ds`.`DispatchToTime` AS `DispatchToTime`,`ds`.`CompanyID` AS `CompanyID`,`ds`.`CompanyName` AS `CompanyName`,`ds`.`CompanyCode` AS `CompanyCode`,`ds`.`LocationID` AS `LocationID`,`ds`.`LocationName` AS `LocationName`,`ds`.`LocationCode` AS `LocationCode`,`ds`.`DriverID` AS `DriverID`,`ds`.`DriverName` AS `DriverName`,`ds`.`DriverCode` AS `DriverCode`,`ds`.`LicenseID` AS `LicenseID`,`ds`.`LicenseName` AS `LicenseName`,`ds`.`IsCancelled` AS `IsCancelled`,`ds`.`IsConfirmed` AS `IsConfirmed`,`ds`.`DriverPayRate` AS `DriverPayRate`,`ds`.`CompanyPayRate` AS `CompanyPayRate`,`ds`.`CompanyPayRateOT` AS `CompanyPayRateOT`,`ds`.`TotalTime` AS `TotalTime`,ifnull(`ld`.`TravelPay`,0.00) AS `DriverTravelPay`,if((`ld`.`TravelPay` is not null),`l`.`TravelPay`,0.00) AS `CompanyTravelPay`,(case when (`h`.`HolidayID` is not null) then 0.0 when (`ds`.`TotalTime` > 8.0) then 8.0 else `ds`.`TotalTime` end) AS `DriverRegularTime`,(case when (`h`.`HolidayID` is not null) then `ds`.`TotalTime` when (`ds`.`TotalTime` > 8.0) then (`ds`.`TotalTime` - 8.0) else 0.0 end) AS `DriverOverTime`,(case when (`ds`.`IsCancelled` = 1) then 8.0 when ((`h`.`HolidayID` is not null) or (weekday(`ds`.`DispatchDate`) in (5,6))) then 0.0 when (`ds`.`TotalTime` > 8.0) then 8.0 else `ds`.`TotalTime` end) AS `CompanyRegularTime`,(case when (`ds`.`IsCancelled` = 1) then 0.0 when ((`h`.`HolidayID` is not null) or (weekday(`ds`.`DispatchDate`) in (5,6))) then `ds`.`TotalTime` when (`ds`.`TotalTime` > 8.0) then (`ds`.`TotalTime` - 8.0) else 0.0 end) AS `CompanyOverTime` from (((`dispatches_raw` `ds` join `locations` `l` on((`ds`.`LocationID` = `l`.`LocationID`))) left join `holidays` `h` on((`h`.`HolidayDate` = `ds`.`DispatchDate`))) left join `locations_drivers` `ld` on(((`ds`.`LocationID` = `ld`.`LocationID`) and (`ds`.`DriverID` = `ld`.`DriverID`))));

--
-- Definition for view dispatches_payments
--
DROP VIEW IF EXISTS dispatches_payments CASCADE;
CREATE OR REPLACE 
	DEFINER = 'root'@'localhost'
VIEW dispatches_payments
AS
	select `ds`.`DispatchID` AS `DispatchID`,`ds`.`DispatchDate` AS `DispatchDate`,`ds`.`DispatchFromTime` AS `DispatchFromTime`,`ds`.`DispatchToTime` AS `DispatchToTime`,`ds`.`CompanyID` AS `CompanyID`,`ds`.`CompanyName` AS `CompanyName`,`ds`.`CompanyCode` AS `CompanyCode`,`ds`.`LocationID` AS `LocationID`,`ds`.`LocationName` AS `LocationName`,`ds`.`LocationCode` AS `LocationCode`,`ds`.`DriverID` AS `DriverID`,`ds`.`DriverName` AS `DriverName`,`ds`.`DriverCode` AS `DriverCode`,`ds`.`LicenseID` AS `LicenseID`,`ds`.`LicenseName` AS `LicenseName`,`ds`.`IsCancelled` AS `IsCancelled`,`ds`.`IsConfirmed` AS `IsConfirmed`,`ds`.`DriverPayRate` AS `DriverPayRate`,`ds`.`CompanyPayRate` AS `CompanyPayRate`,`ds`.`CompanyPayRateOT` AS `CompanyPayRateOT`,`ds`.`TotalTime` AS `TotalTime`,`ds`.`DriverTravelPay` AS `DriverTravelPay`,`ds`.`CompanyTravelPay` AS `CompanyTravelPay`,`ds`.`DriverRegularTime` AS `DriverRegularTime`,`ds`.`DriverOverTime` AS `DriverOverTime`,`ds`.`CompanyRegularTime` AS `CompanyRegularTime`,`ds`.`CompanyOverTime` AS `CompanyOverTime`,(`ds`.`DriverRegularTime` * `ds`.`DriverPayRate`) AS `DriverRegularPay`,((`ds`.`DriverOverTime` * `ds`.`DriverPayRate`) * 1.5) AS `DriverOverTimePay`,(((`ds`.`DriverRegularTime` * `ds`.`DriverPayRate`) + ((`ds`.`DriverOverTime` * `ds`.`DriverPayRate`) * 1.5)) + `ds`.`DriverTravelPay`) AS `DriverTotalPay`,(`ds`.`CompanyRegularTime` * `ds`.`CompanyPayRate`) AS `CompanyRegularPay`,(`ds`.`CompanyOverTime` * `ds`.`CompanyPayRateOT`) AS `CompanyOverTimePay`,(((`ds`.`CompanyRegularTime` * `ds`.`CompanyPayRate`) + (`ds`.`CompanyOverTime` * `ds`.`CompanyPayRateOT`)) + `ds`.`CompanyTravelPay`) AS `CompanyTotalPay` from `dispatches_hours` `ds`;

